import Header from "./Components/Header";


function App() {
  const [basketData, setBasketData] = useState([]);

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <BasicTable
              setBasketData={setBasketData}
            />
          }
        />
        <Route
          path="/basket"
          element={
            <Basket
              basketData={basketData}
            />
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
